import image from './2023.png';
import './home.css';
import img from './img.svg';
import Offers from './offers.js';
import click1 from './click.js';
function Home(){

    return (
        <>
        <div className='home-box'>
            <div className='about'>
                 <div className='top-offer' id='top-offer'><Offers/><Offers/><Offers/><Offers/><Offers/><Offers/></div>
                <img className='img' src={img}/>
            </div>
        </div>
        
        </>
    );
}

export default Home;
